import React, { Component } from 'react';
import './../CSS/Timeline.css'
class Timeline extends Component{

    constructor(props){
        super(props);
        this.state = [null, null];
    }


    render(){

        return(
            <>
                <div className="Feed">
                    <h2>
                        Title
                    </h2>
                    <div className="News">
                        This is news.
                    </div>
                </div>

                <div>
                    <h2>
                        Title2
                    </h2>
                    <div className="News">
                        This is news.
                    </div>
                </div>
            </>
        )
    }

}

export default Timeline;
